import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <form action="">
        <input type="text" name="songName" placeholder="song name" />
        <input type="text" name="artistName" placeholder="artist name" />
      </form>
    </div>
  );
}

export default App;
